import "../styles/method.css";
import { React, useState } from "react";

export const Search = (props) => {
  const riceDataSort = () => {
    fetch("/data") // リクエストURLは適切に設定してください
      .then(function (response) {
        return response.json(); // サーバーレスポンスをJSON形式で解析
      })
      .then(function (data) {
        // 受け取ったデータをフィルタリングします
        var filteredData = data.filter(function (item) {
          return item.age === 30;
        });

        // フィルタリング結果を表示します（仮の表示方法としてコンソールに出力）
        console.log(filteredData);
      })
      .catch(function (error) {
        console.error("エラー:", error);
      });
  };

  return (
    <>
      <button id="rice" onClick={riceDataSort}>
        ごはん
      </button>
      <button>パスタ</button>
    </>
  );
};
